() => {
		let schema_class = Register_form.data.RegisterBundle_schemaClass.split(",");
		let lenght = schema_class.length;
		let schema_class_ids = new Array(lenght);

		for (let i=0; i<lenght;i++){
			schema_class_ids[i] = parseInt(schema_class[i]);
		}

		return (schema_class_ids)
	}

